r($,"bjY","b07",()=>A.a([A.aS7("**EcoGrow** h\u01b0\u1edbng t\u1edbi vi\u1ec7c tr\u1edf th\xe0nh m\u1ed9t d\u1ef1 \xe1n ti\xean phong trong vi\u1ec7c t\xe1i t\u1ea1o kh\xf4ng gian xanh v\xe0 b\u1ea3o v\u1ec7 m\xf4i tr\u01b0\u1eddng t\u1ea1i Vi\u1ec7t Nam, g\xf3p ph\u1ea7n c\u1ea3i thi\u1ec7n ch\u1ea5t l\u01b0\u1ee3ng kh\xf4ng kh\xed, ch\u1ed1ng bi\u1ebfn \u0111\u1ed5i kh\xed h\u1eadu v\xe0 x\xe2y d\u1ef1ng m\u1ed9t th\u1ebf gi\u1edbi b\u1ec1n v\u1eefng. Ch\xfang t\xf4i m\u01a1 \u01b0\u1edbc v\u1ec1 m\u1ed9t t\u01b0\u01a1ng lai n\u01a1i m\xe0 c\xe1c th\xe0nh ph\u1ed1 Vi\u1ec7t Nam kh\xf4ng ch\u1ec9 ph\xe1t tri\u1ec3n hi\u1ec7n \u0111\u1ea1i m\xe0 c\xf2n xanh t\u01b0\u01a1i, s\u1ea1ch \u0111\u1eb9p, v\u1edbi h\xe0ng tri\u1ec7u c\xe2y xanh \u0111\u01b0\u1ee3c tr\u1ed3ng, ph\u1ee7 xanh kh\u1eafp m\u1ecdi mi\u1ec1n \u0111\u1ea5t n\u01b0\u1edbc. M\u1ee5c ti\xeau cu\u1ed1i c\xf9ng c\u1ee7a ch\xfang t\xf4i l\xe0 t\u1ea1o ra m\u1ed9t th\u1ebf gi\u1edbi m\xe0 con ng\u01b0\u1eddi s\u1ed1ng h\xe0i h\xf2a v\u1edbi thi\xean nhi\xean, n\u01a1i m\u1ed7i h\xe0nh \u0111\u1ed9ng nh\u1ecf \u0111\u1ec1u \u0111\xf3ng g\xf3p v\xe0o vi\u1ec7c b\u1ea3o v\u1ec7 h\xe0nh tinh cho c\xe1c th\u1ebf h\u1ec7 t\u01b0\u01a1ng lai.","T\u1ea7m nh\xecn (Vision)"),A.aS7("S\u1ee9 m\u1ec7nh c\u1ee7a **EcoGrow** l\xe0 truy\u1ec1n c\u1ea3m h\u1ee9ng v\xe0 k\u1ebft n\u1ed1i c\u1ed9ng \u0111\u1ed3ng trong vi\u1ec7c tr\u1ed3ng c\xe2y v\xe0 s\u1ed1ng xanh. Ch\xfang t\xf4i k\xeau g\u1ecdi m\u1ecdi ng\u01b0\u1eddi c\xf9ng chung tay b\u1ea3o v\u1ec7 m\xf4i tr\u01b0\u1eddng b\u1eb1ng c\xe1ch \u0111\xf3ng g\xf3p v\xe0o c\xe1c d\u1ef1 \xe1n tr\u1ed3ng c\xe2y, gi\xe1o d\u1ee5c v\xe0 n\xe2ng cao nh\u1eadn th\u1ee9c v\u1ec1 l\u1ed1i s\u1ed1ng b\u1ec1n v\u1eefng. Th\xf4ng qua c\xe1c ho\u1ea1t \u0111\u1ed9ng thi\u1ebft th\u1ef1c, **EcoGrow** kh\xf4ng ch\u1ec9 tr\u1ed3ng c\xe2y m\xe0 c\xf2n tr\u1ed3ng ni\u1ec1m tin v\xe0 hy v\u1ecdng v\xe0o m\u1ed9t t\u01b0\u01a1ng lai xanh. Ch\xfang t\xf4i cam k\u1ebft mang l\u1ea1i s\u1ef1 thay \u0111\u1ed5i t\xedch c\u1ef1c cho m\xf4i tr\u01b0\u1eddng s\u1ed1ng, \u0111\u1ed3ng th\u1eddi t\u1ea1o ra m\u1ed9t c\u1ed9ng \u0111\u1ed3ng c\xf3 tr\xe1ch nhi\u1ec7m v\u1edbi h\xe0nh tinh v\xe0 khuy\u1ebfn kh\xedch m\u1ecdi ng\u01b0\u1eddi h\xe0nh \u0111\u1ed9ng v\xec m\xf4i tr\u01b0\u1eddng t\u1eeb nh\u1eefng vi\u1ec7c nh\u1ecf nh\u1ea5t.","S\u1ee9 m\u1ec7nh (Mission)")],A.a5("m<Tj>")))
